import React from 'react'
import '../seeAllUsers/ButtonGoBack.css'
import { Router,Link, Route, Switch } from 'react-router-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {faBehance,faLinkedinIn} from  '@fortawesome/free-brands-svg-icons'



export const ButtonGoBack = (props) => {
    return(
        <Link to="/home" className="">
            <button className="goBack-btn">
                <p>
                <FontAwesomeIcon icon={faBehance}/>{props.text}
                </p>
            </button>
        </Link>
    )
}
